import React from 'react';
import './Sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar-item">
        <button className="sidebar-button active">Home</button>
      </div>
      <div className="sidebar-item">
        <button className="sidebar-button">Transactions</button>
      </div>
      <div className="sidebar-item">
        <button className="sidebar-button">Administration</button>
      </div>
      <div className="sidebar-item">
        <button className="sidebar-button">Supporters</button>
      </div>
      <div className="sidebar-item">
        <button className="sidebar-button">Messages</button>
      </div>
      <div className="sidebar-item">
        <button className="sidebar-button">Reports</button>
      </div>
      <div className="sidebar-item">
        <button className="sidebar-button">Setting</button>
      </div>
    </div>
  );
};

export default Sidebar;
